column8:
抗菌タイプに抗ウイルス、アレル物質抑制機能を追加し、さらに快適性を追求。<br>
花粉・ほこりだけでなく、微小粒子（PM2.5）の除去にも効果を発揮します。<br>
●ウイルスをしっかり抑制<br>
植物由来の天然ポリフェノールを採用。フィルターにて捕集されたウイルスの活動を抑制。車内をクリーンに快適に。<br>
●アレル物質をしっかり抑制<br>
植物由来の天然ポリフェノールを採用。フィルターにて捕集された花粉などのアレル物質を抑制。不快物質をブロック。<br>
●菌・カビの繁殖を抑制<br>
高い抗菌効果を発揮する抗菌剤を採用。フィルター表面に付着した菌、カビの繁殖を抑制。クリーンな空気を車内へ供給。<br>
●イヤなにおいを強力脱臭<br>
高性能活性炭を採用。排ガス、タバコ、カビ、ペットなどのイヤなにおいを吸着し、高い脱臭効果を発揮。<br>
●花粉の侵入をブロック<br>
帯電超極細不織布を採用。通気性を低下させることなく花粉、チリ、ホコリなど0.3μ以上の粉塵をしっかりブロック。<br>
